    // START OF: tabs =====
    window['unicornplatform'].tabs = (function(){
        function setHeight() {
            function changeHeight($tabs) {
                var $item = $tabs.find('.js-tab-content-item');
                var maxHeight = 0;
                var currentHeight = 0;

                var imgCount = $item.length;
                for(var i = 0; i < imgCount; i++){
                    currentHeight = $item.eq(i).outerHeight();
                    if(currentHeight > maxHeight){
                        maxHeight = currentHeight;
                    }
                }

                $tabs.animate({'height': maxHeight});
            }

            function bindOnResize() {
                var timeout = false, // holder for timeout id
                    delay = 350; // delay after event is "complete" to run callback

                // window.resize event listener recals height on every window resize acton with a throttle
                window.addEventListener('resize', function() {
                    // clear the timeout
                    clearTimeout(timeout);
                    // start timing for event "completion"
                    timeout = setTimeout(setAll, delay);
                });
            }

            function setAll() {
                var $tabs = $('.js-tabs-item-list');

                if($tabs.length > 0){
                    //Set height for each Tabs component
                    var $tabsCount = $tabs.length;
                    for(var i = 0; i < $tabsCount; i++){
                        changeHeight($tabs.eq(i));
                    }
                }
            }
            setAll(); //Set all height when images are ready.
            bindOnResize();//Also reset heights on resize with a throttle.
            window.onload = setAll;//Also set height one more time after all images are loaded in case the script fired BEFORE images loaded and their height=0
        }
        function bindClick() {
            $(document).on('click', '.js-open-tab', function(event) {
            	event.preventDefault();

                if($(this).hasClass('state-active-tab')){
                    return false;
                }
                var index = $(this).attr('data-index');
                var group = $(this).attr('data-group');

                //press button
                var $allTabs = $('.js-open-tab[data-group="' + group + '"]');
                $allTabs.removeClass('state-active-tab');

                $(this).addClass('state-active-tab');

                //change tab content
                var $allTabContents = $('.js-tab-content[data-group="' + group + '"]');
                $allTabContents.removeClass('state-active-tab');

                var $targetTabContent = $('.js-tab-content[data-group="' + group + '"][data-index="' + index + '"]');
                $targetTabContent.addClass('state-active-tab');
            });
        }

    	function init(){
    		setHeight();
            bindClick();
    	}
    	return {
    		init: init
    	}
    }());

