    // START OF: show error box =====
    var showError = (function(){
    	function showManually(errorMessageText){
            // Use this function to show the error box.

            if(errorMessageText !== undefined){
                $('.js-form-error-message').text(errorMessageText);
            }

    		$('.js-form-error-box').addClass('state-visible');
    	}

        function getUrlParameter(name) {
            //via https://davidwalsh.name/query-string-javascript
            name = name.replace(/[\[]/, '\\[').replace(/[\]]/, '\\]');
            var regex = new RegExp('[\\?&]' + name + '=([^&#]*)');
            var results = regex.exec(location.search);
            return results === null ? '' : decodeURIComponent(results[1].replace(/\+/g, ' '));
        };
        function showAutomatically() {
            // This function automatically displays the value of the "error_message" GET param in the error box.
            var errorMessageText = getUrlParameter("error_message");
            if(errorMessageText.length > 0){
                $('.js-form-error-box').addClass('state-visible');
                $('.js-form-error-message').text(errorMessageText);
            }
        }
    	return {
    		showManually: showManually,
            showAutomatically: showAutomatically
    	}
    }());

    showError.showAutomatically();
